import React from "react";
import Dismissal from "./Dismissal";

function Items(props) {
  const { items } = props;

  return (
    <div className="items">
      {items.map((item) => (
        <div key={item.id} className="item">
          <img src={item.img} alt={item.title} />
          <h3>{item.title}</h3>
          <p>{item.desc}</p>
          <Dismissal />
        </div>
      ))}
    </div>
  );
}

export default Items;
